    data: |
      SELECT + ( + - 39 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q65.out
    data: |
      -39
      -39
      -39
      -39
      -39
      -39
      -39
      -39
      -39
